import React from 'react';
import { Carousel } from 'react-responsive-carousel';
import 'react-responsive-carousel/lib/styles/carousel.min.css';

const CarouselComponent = () => {
  return (
    <div className="relative mt-5 m-20 rounded-3xl overflow-hidden">
      <Carousel showThumbs={false} showStatus={false} autoPlay={true}> 
        <div >
          <img src="http://fakeimg.pl/2000x800/0079D8/fff/?text=Without" alt="Slide 1" />
        </div>
        <div>
          <img src="http://fakeimg.pl/2000x800/DA5930/fff/?text=JavaScript" alt="Slide 2" />
        </div>
        <div>
          <img src="http://fakeimg.pl/2000x800/F90/fff/?text=Carousel" alt="Slide 3" />
        </div>
      </Carousel>
    </div>
  );
};

export default CarouselComponent;
